import java.util.Arrays;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.originalDigits(""));
        System.out.println(solution.originalDigits("esnveesnve"));
        System.out.println(solution.originalDigits("fviefuro"));
        System.out.println(solution.originalDigits("owoztneoer"));

    }

    public String originalDigits(String s) {
        HashMap<Character, Integer> set = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            if (set.containsKey(s.charAt(i))) {
                set.put(s.charAt(i), set.get(s.charAt(i)) + 1);
            } else {
                set.put(s.charAt(i), 1);
            }
        }
        Map<String, String> mapping = new HashMap<>();
        mapping.put("zero", "0");
        mapping.put("one", "1");
        mapping.put("two", "2");
        mapping.put("three", "3");
        mapping.put("four", "4");
        mapping.put("five", "5");
        mapping.put("six", "6");
        mapping.put("seven", "7");
        mapping.put("eight", "8");
        mapping.put("nine", "9");
        StringBuffer sb = new StringBuffer();

        List<String> order = Arrays.asList("zero","one","two","three","four","five","six","seven","eight","nine");

        for (String key : order) {
            if(set.isEmpty()) break;
            int i;
            int minNumber = Integer.MAX_VALUE;
            for (i = 0; i < key.length(); i++) {
                if (!set.containsKey(key.charAt(i))) {
                    break;
                }

                minNumber = Math.min(minNumber, set.get(key.charAt(i)));
            }
            if (i != key.length()) {
                continue;
            }
            for (int j = 0; j < key.length(); j++) {
                char key1 = key.charAt(j);
                Integer integer = set.get(key1);

                if (integer == minNumber) {
                    set.remove(key1);
                } else {
                    set.put(key1, integer - minNumber);
                }

            }
            for (int j = 0; j < minNumber; j++) {
                sb.append(mapping.get(key));
            }

        }
        return sb.toString();
    }


}
